import React from 'react'
import ReactDOM from 'react-dom'


const Header = (props) => {
  return (
    <h1>
      <p>{props.title}</p>
    </h1>
  )
}

const Entry = (props) => {  

  return(
    <div>
      <p>{props.name} {props.phone}</p>      
    </div>
  )


}

const Contents = () => {

  const name1 = 'John Doe'
  const phone1 = '358401234567'
  const name2 = 'Jane Doe'
  const phone2 = '44551234567'
  const name3 = 'Foo bar'
  const phone3 = '000'

  return (
    <div>
      <Entry name = {name1} phone = {phone1} />
      <Entry name = {name2} phone = {phone2} />
      <Entry name = {name3} phone = {phone3} />
    </div>
  )
}

const App = () => {

  const title = 'Superadvanced web phonebook app'
  const contact1 = {
    name: 'John Doe',
    phonenumber: '358401234567'
  }
  const contact2 = {
    name: 'Jane Doe',
    phonenumber: '44551234567'
  }
  const contact3 = {
    name: 'Foo bar',
    phonenumber: '000'
  }

  return (
    <div>
      <Header />
      <Contents />
    </div>
  )
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
)
